export default function Homepage() {
 const txt = "Hello World";

  function typeWriter() {

    for (let i = 0; i < txt.length; i++) {
      document.getElementById("helloWorld").innerHTML += txt.charAt(i);
    }
  }

  return (
    <div>
      <h1>Dylan Mcgrann</h1>
      <span id="helloWorld">{setTimeout(typeWriter(),1000)}</span>
    </div>
  )
}
